import styled from 'styled-components';

const Button = styled.button`
  margin: 0 5px;
  background: transparent;
  border 2px solid pink;
  border-radius: 10px;
  box-shadow: 0px 0px 4px gray;
  display: flex;
  align-items: center;
  justify-content: center;
`;

export default Button;
